The '''1892 [[VMI Keydets]] football team''' represented the [[Virginia Military Institute]] in their second ever season of organized football. The Keydets went 4-0-1, a game better than they were the previous season.<ref name="VMI">[http://www.vmikeydets.com/pdf8/708636.pdf VMI Football Record Book.qxp<!-- Bot generated title -->]</ref>
